__NUXT_JSONP__("/drugs/Roniciclib", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1223498-69-8",chebiId:b,chemicalFormula:b,definition:"An orally bioavailable cyclin dependent kinase (CDK) inhibitor with potential antineoplastic activity. Roniciclib selectively binds to and inhibits the activity of CDK1\u002FCyclin B, CDK2\u002FCyclin E, CDK4\u002FCyclin D1, and CDK9\u002FCyclin T1, serine\u002Fthreonine kinases that play key roles in the regulation of the cell cycle progression and cellular proliferation. Inhibition of these kinases leads to cell cycle arrest during the G1\u002FS transition, thereby leading to an induction of apoptosis, and inhibition of tumor cell proliferation. CDKs are often dysregulated in cancerous cells.",fdaUniiCode:"0W9Q8U337A",identifier:"C92579",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C129825","C2185"],synonyms:["BAY1000394","RONICICLIB",a]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FRoniciclib",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Roniciclib","","2021-10-30T13:47:38.903Z")));